     * @return false|mixed
     */
    public function addOrderRecord($data, $pay_price, $member_grade, $no_discount_price, $wid, $is_new_coupons = 2)
    {
        //查询new_order_id ;
        $new_order_info=NewOrder::where('saas_order_id',$data['saas_order_id'])->first();
